import React from 'react';

function Profile() {
  return (
    <div className="column-list">
      <div style={{ width: '50%' }} className="column">
        <figure className="image">
          <a href="profilephoto.jpg">
            <img style={{ width: '906px' }} src="profilephoto.jpg" alt="Profile" />
          </a>
        </figure>
      </div>
      <div style={{ width: '50%' }} className="column">
        <h2>Bohyeon Park | 박보현</h2>
        <p>I’m interested in Solutions Architecting and Cloud Engineering : )</p>
        <p>
          <mark className="highlight-orange_background">
            <code>Cloud Engineering</code>
          </mark>{' '}
          <mark className="highlight-red_background">
            <code>Solutions Architect</code>
          </mark>{' '}
          <mark className="highlight-blue_background">
            <code>AWS</code>
          </mark>{' '}
          <code>GCP</code>
        </p>
      </div>
    </div>
  );
}

export default Profile;
